export default function Chart(){
    
    const [toRender, changeRender] = useState(false);
    return   <div style={{padding  : '10px'}}>

        <hr/>
        <h3 style={{textAlign:'center'}}>React Vis</h3>
        
        <button style={{display : "block"}} 
                onClick={()=>changeRender(!toRender)}> Click me to turn on and off charts </button>
        <button style={{display : "block"}}
        > Click me to check if I am responsive while I am rendering </button>
        
        {toRender &&  <XYPlot width={1200} height={500} stackBy="y" xType="ordinal">

            <XAxis />
            <YAxis />
            {
                data.map((barData, i) => <BarSeries data={barData} key={i}/>)
            }
        </XYPlot>}
    </div>
}
